import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Link,
  Route
} from 'react-router-dom'

import Home from "./Home";

import '../styles/App.css';
import { render } from '@testing-library/react';

function App() {
  return(
    <Router>
      <div>
        <Switch>
          <Route exact={true} path='/'>
            <Home/>
          </Route>
        </Switch>
      </div>
    </Router>
  )
}

export default App;
